// NavigationBar.js
import React from 'react';
import { NavLink } from 'react-router-dom';
import styles from './Navigationbar.module.css';

function NavigationBar() {
  return (
    <nav className={styles.nav}>
      <ul>
        <li>
          <NavLink to="/" exact className={styles.navLink} activeClassName={styles.activeLink}>
            Home
          </NavLink>
        </li>
        <li>
          <NavLink to="/RizikoveFaktory" exact className={styles.navLink} activeClassName={styles.activeLink}>
            Rizikov√© Faktory
          </NavLink>
        </li>
        <li>
          <NavLink to="/Dotaznik" exact className={styles.navLink} activeClassName={styles.activeLink}>
            Dotaznik
          </NavLink>
        </li>
      </ul>
    </nav>
  );
}

export default NavigationBar;
